    ('0191c6e8-e8c1-7f4e-aea6-214c08abdfc2', '98', 'Rehab', 'Rehab', ' begrepp inom sjukvård, socialvård och kriminalvård. Syftet med rehabilitering är att hitta ett optimalt sätt för en person att kunna återvända till dagligt liv och återfå en rimlig hälsa efter, till exempel, fysiologisk eller mental sjukdom som lett till funktionsnedsättning. I de fall skadan inte läker eller resulterar i långvarig funktionsnedsättning krävs rehabiliterande insatser för att underlätta ett normalt fungerande liv.', now(), now(), 'DB Import', 'DB Import', 1),
