    ('0191c6e8-e8c2-7139-89a4-644ae8aa5ac5', '112', 'Särskilt boende', 'Särskilt boende', 'Gemensamma namnet för boendeformer i en kommun enligt hälso- och sjukvårdslagen, som har anpassats för individer med stort behov av omsorg. Dessa boendeformer ser olika ut i olika kommuner. Till de särskilda boendeformerna hör ålderdomshem, servicehus, gruppbostäder och sjukhem ', now(), now(), 'DB Import', 'DB Import', 1),
