    ('0191c6e8-e8c2-796f-88a9-c8c01ea6cf8c', '118', 'Ätstörning', 'Ätstörning', 'Samlingsterm för ett antal sjukliga mönster vid födointag, t. ex. anorexi och bulimi', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-77d0-bcbe-5e45ae8897c8', '2.1.1.1', 'Regional hälso- och sjukvård//Primärvård//Arbetsterapi', 'Regional hälso- och sjukvård//Primärvård//Arbetsterapi', 'Yrkesfunktion som hjälper individer att återfå önskad aktivitetsförmåga. Fokuserar på att ta vara på de förmågor som individen besitter och utifrån detta finna ett alternativt tillvägagångssätt, träna för att återfå förmåga helt eller delvis och ge råd vid anpassning av den fysiska miljön. Arbetar också med förebyggande åtgärder. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-7e1d-8fd6-ecc7403a3de4', '2.1.1.2', 'Regional hälso- och sjukvård//Primärvård//Dietist', 'Regional hälso- och sjukvård//Primärvård//Dietist', 'Yrkesfuntion som nutritionsbehandlar sjuka såväl som friska individer. Ger kvalificerad kostrådgivning till människor som på grund av sjukdom eller av profylaktiska skäl behöver förändra sin kosthållning.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-79b6-a90c-1a2583237d46', '2.1.1.3', 'Regional hälso- och sjukvård//Primärvård//Distriktssköterska', 'Regional hälso- och sjukvård//Primärvård//Distriktssköterska', 'Grunden i distriktssköterskans arbete är att med ett hälsofrämjande synsätt utgöra ett stöd för människor i alla åldrar och sjukdomstillstånd. Detta kan i primärvård innefatta olika typer av mottagningverksamhet, men också rådgivning och hembesök.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-72e6-9056-17713eb4525f', '2.1.1.4', 'Regional hälso- och sjukvård//Primärvård//Fysioterapi', 'Regional hälso- och sjukvård//Primärvård//Fysioterapi', 'Yrkesfunktion som utför bedömning och behandling av problem med andning, kondition, motorik, styrka, ledrörlighet och smärta. En fysioterapeuts fokus är på sjukdomar och skador men kan även fokusera på hälsa och beteendeförändringar.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-73d0-9091-ff976dfcf078', '2.1.1.5', 'Regional hälso- och sjukvård//Primärvård//Distriktsläkare', 'Regional hälso- och sjukvård//Primärvård//Distriktsläkare', 'Yreksfuntion som möter människor i alla åldrar med alla sorters hälsorelaterade problem och bedömer och behandlar dessa. Under lång tid också kunna följa en individs olika hälsoproblem och i bedömningen av dessa kunna väga in personens hela livssituation', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-7906-867f-24dc0e0cc4e6', '2.1.1.6', 'Regional hälso- och sjukvård//Primärvård//Provtagning', 'Regional hälso- och sjukvård//Primärvård//Provtagning', 'Enhet som på ordination utför provtagning, däribland blodprovtagning, blodtrycksmätning och urinprov.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-7ce6-b187-80529d9b89b1', '2.1.1.7', 'Regional hälso- och sjukvård//Primärvård//Administration', 'Regional hälso- och sjukvård//Primärvård//Administration', 'Yrkesfunktion som utför skrivande av intyg, remisser, journaler samt receptionstjänst, statistikhantering och andra administrativa uppgifter.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-7ca6-8ade-69286e756987', '2.1.1.8', 'Regional hälso- och sjukvård//Primärvård//Närvårdsverksamhet ', 'Regional hälso- och sjukvård//Primärvård//Närvårdsverksamhet ', 'Enhet som tar emot patienter som behöver inneliggande vård under en begränsad tid, och inte behöver sjukhusets resurser i form av avancerad diagnostik eller behandling.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-7cf4-9824-15845a00eac7', '2.1.1.9', 'Regional hälso- och sjukvård//Primärvård//Barnahälsovård', 'Regional hälso- och sjukvård//Primärvård//Barnahälsovård', 'Barnhälsovårdens huvuduppgift är att stödja och följa alla barns hälsa, utveckling och uppväxtmiljö. Den ska också förebygga ohälsa hos barn och tidigt uppmärksamma och åtgärda problem. Riktar sig till barn mellan 0 och 5 år. Bemannas av distriks-/ barn- eller sjuksköterskor.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-7455-86df-71e16d763836', '2.1.1.10', 'Regional hälso- och sjukvård//Primärvård//Mödrahälsovård', 'Regional hälso- och sjukvård//Primärvård//Mödrahälsovård', 'Bemannas av barnmorskor och erbjuder graviditetsövervakning, förlossning- och föräldraförberedelse. Erbjuder även preventivmedelsrådgivning,  provtagning vid misstanke om könssjukdom samt utför gynekologisk cellprovskontroll.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-7737-acb4-f3c018bbe803', '2.1.1.11', 'Regional hälso- och sjukvård//Primärvård//Ungdomsmottagning', 'Regional hälso- och sjukvård//Primärvård//Ungdomsmottagning', 'På en ungdomsmottagning kan unga bland annat få hjälp med preventivmedel, graviditetstest, p-piller, kondom, provtagning för könssjukdom och samtal vid psykisk ohälsa och frågor om relationer, identitet, sex och kroppen.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-779e-9e83-8235ebfd05e6', '2.1.1.12', 'Regional hälso- och sjukvård//Primärvård//Palliativ vård', 'Regional hälso- och sjukvård//Primärvård//Palliativ vård', 'Omfattar vård av en patient med icke botbar sjukdom, med förväntad dödlig utgång. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-7b15-9300-6cef1a348573', '2.1.1.13', 'Regional hälso- och sjukvård//Primärvård//Hemsjukvård', 'Regional hälso- och sjukvård//Primärvård//Hemsjukvård', 'Hälso- och sjukvård som utförs i patientens ordinära boende.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-7eaa-9877-11c22d179a69', '2.1.1.14', 'Regional hälso- och sjukvård//Primärvård//Psykologverksamhet', 'Regional hälso- och sjukvård//Primärvård//Psykologverksamhet', 'Yrkesfunktion som arbetar med människors psykiska hälsa och ohälsa genom att förebygga, utreda, diagnostisera och behandla psykiska problem och sjukdomar.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-72fb-a01b-412096b3dd99', '2.1.1.15', 'Regional hälso- och sjukvård//Primärvård//Barn- och ungdomsmedicin', 'Regional hälso- och sjukvård//Primärvård//Barn- och ungdomsmedicin', 'Öppenvårdsmottagning som erbjuder specialistvård för barn och ungdomar mellan 0-18 år. Mottagningen gör medicinska utredningar och behandlingar av kroniska sjukdomar som inte kräver att barnet blir inlagd på sjukhus.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-7454-bc3e-0606aefa51b0', '2.1.1.16', 'Regional hälso- och sjukvård//Primärvård//Kuratorsverksamhet', 'Regional hälso- och sjukvård//Primärvård//Kuratorsverksamhet', 'Yrkesfunktion som arbetar med psykosociala frågor som innefattar ekonomi, boende, sysselsättning. Arbetar även med stödsamtal, psykosocialt behandlingsarbete och att handleda andra yrkeskategorier i psykosociala frågor.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-7588-9313-c49d4b6f02fd', '2.1.1.17', 'Regional hälso- och sjukvård//Primärvård//Akutverksamhet i primärvård', 'Regional hälso- och sjukvård//Primärvård//Akutverksamhet i primärvård', 'För patienter som har akut behov av vård som inte kan vänta till nästa vardag och som inte har livshotande tillstånd.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-77d5-983a-1f1c9f697aa5', '2.1.2.1', 'Regional hälso- och sjukvård//Specialiserad Psykiatrisk vård//Allmänpsykiatri', 'Regional hälso- och sjukvård//Specialiserad Psykiatrisk vård//Allmänpsykiatri', 'Allmänpsykiatrin är till för vuxna med svår psykisk sjukdom eller psykiatrisk problematik. Vi bedömer, utreder, diagnostiserar och behandlar samt rehabiliterar. Vårdcentralen är oftast det första steget vid utveckling psykisk sjukdom eller problem med den psykiska hälsan. Vid behov remitterar vårdcentralen till specialistvård inom psykiatrin.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-7170-9392-ff0394841e78', '2.1.2.2', 'Regional hälso- och sjukvård//Specialiserad Psykiatrisk vård//Psykosvård, vuxna', 'Regional hälso- och sjukvård//Specialiserad Psykiatrisk vård//Psykosvård, vuxna', 'Erbjuder psykiatrisk specialistvård för patienter som har, eller håller på att utredas för, en psykossjukdom.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-7d26-ba8d-542e2452e9e2', '2.1.2.3', 'Regional hälso- och sjukvård//Specialiserad Psykiatrisk vård//Beroendevård, vuxna', 'Regional hälso- och sjukvård//Specialiserad Psykiatrisk vård//Beroendevård, vuxna', 'Erbjuder psykiatrisk specialistvård till dem som samtidigt är beroende av alkohol och/eller narkotika. Vi behandlar även svåra beroendesyndrom med eller utan samtidig psykisk sjukdom där behovet inte har kunnat tillgodoses hos kommunen eller vårdcentralen.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-7f55-903c-9078e3bddaa7', '2.1.2.4', 'Regional hälso- och sjukvård//Specialiserad Psykiatrisk vård//Barn- och ungdomspsykiatri', 'Regional hälso- och sjukvård//Specialiserad Psykiatrisk vård//Barn- och ungdomspsykiatri', 'Erbjuder rådgivning, utredning och behandling till barn och unga med psykisk sjukdom och/eller psykiatrisk problematik. Vi ger information om fakta, tips och självhjälp såväl till barn och unga som till anhöriga och närstående.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-742a-abd9-26679ff53551', '2.1.2.5', 'Regional hälso- och sjukvård//Specialiserad Psykiatrisk vård//Rättspsykiatri', 'Regional hälso- och sjukvård//Specialiserad Psykiatrisk vård//Rättspsykiatri', 'Erbjuder vård till personer dömda enligt lagen om rättspsykiatrisk vård och som består av en kombination av samtal, medicinering och social träning. Målet med vården är att förbättra patientens psykiska hälsa för att kunna ha ett bra fungerande liv, och minimera risken för återfall i allvarliga brott.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-7c73-9a57-cc40a46d0acb', '2.1.2.6', 'Regional hälso- och sjukvård//Specialiserad Psykiatrisk vård//Habilitering', 'Regional hälso- och sjukvård//Specialiserad Psykiatrisk vård//Habilitering', 'Habilitering är det stöd och den behandling som ges till barn, ungdomar och vuxna med funktionsnedsättning för att de ska få möjlighet att bibehålla och utveckla sina förmågor.', now(), now(), 'DB Import', 'DB Import', 1),
