    ('0191c6e8-e8c2-7208-8ec2-dea2d6519094', '1600', 'Arbete', 'Arbete', '\"mänsklig verksamhet som genererar ekonomiskt värde i form av varor eller tjänster. Synonymer: Anställning, jobb. Arbete som är betalt\"', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-73d2-8d40-3c7fa3819231', '1735', 'Arbetsmarknadsanställning', 'Arbetsmarknadsanställning', 'En arbetsmarknadspolitisk åtgärd i form av anställning med lön i offentlig verksamhet, ofta delvis finansierad av statligt anställningsstöd från Arbetsförmedlingen', now(), now(), 'DB Import', 'DB Import', 1),
