    ('0191c6e8-e8c2-7140-b2c7-0c1df2531c92', '1745', 'Arbetsmarknadsinsats/Arbetsmarknadsaktivitet', 'Arbetsmarknadsinsats/Arbetsmarknadsaktivitet', 'Insats/aktivitet för individens väg mot studier eller arbetsmarknad', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-70e7-9318-e8f806be298a', '1750', 'Arbetsmarknadsplanering', 'Arbetsmarknadsplanering', '\"Planering av vilka insatser och aktiviteter som ska ordnas för att den arbetssökande ska komma till självförsörjning, t.ex. via arbete eller studier. Kan sammanställas i en handlingsplan.\"', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-7b04-9029-b5d7ac28d91a', '1755', 'Arbetsmarknadsprojekt', 'Arbetsmarknadsprojekt', 'Ett projekt som ska föra arbetslösa personer närmare självförsörjning i form av arbete eller studier.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-7578-a619-25a38ba5db0b', '1760', 'Arbetsmarknadsutbildning (AUB)', 'Arbetsmarknadsutbildning (AUB)', 'En arbetsmarknadsutbildning är en utbildning till ett yrke där det finns ett rekryteringsbehov', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-792e-99d0-495d98097df0', '1900', 'Arbetsplats', 'Arbetsplats', 'Geografisk eller fysisk plats där arbetet utförs', now(), now(), 'DB Import', 'DB Import', 1),
