    ('0191c6e8-e8c2-7a4e-91d1-5e9a58f2d8ec', '1910', 'Arbetspraktik', 'Arbetspraktik', 'Arbetspraktik är en aktivitet för arbetssökande som exempelvis behöver prova ett nytt yrke eller få referenser för att närma sig arbetsmarknaden.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8c2-782c-9803-c07a784e5f0d', '1915', 'Arbetsprövning', 'Arbetsprövning', 'Utredning avseende arbetsmoments utförande för att utröna arbetsförmågegrad.', now(), now(), 'DB Import', 'DB Import', 1),
