    ('0191c6e8-e8c2-77eb-a90b-a3472c2048e3', '2395', 'BEA avtal', 'BEA avtal', 'Lönekollektivavtal som gäller för anställning av arbetstagare som anvisats för skyddat arbete hos en offentlig arbetsgivare (OSA).', now(), now(), 'DB Import', 'DB Import', 1),
