    ('0191c6e8-e8c2-7b06-a097-0e3bbf54d3b6', '3000', 'Coachning', 'Coachning', '\"Lösningsfokuserad samtalsteknik som går ut på att hjälpa en person eller en grupp personer att bli mer aktiv och mer effektivt använda sina förmågor att nå vissa mål.\"', now(), now(), 'DB Import', 'DB Import', 1),
