    ('0191c6e8-e8cb-7c70-bfcb-aba1d387626e', '1033', 'Psykologverksamhet, barn och ungdom', 'Psykologverksamhet, barn och ungdom', 'Verksamhet där man genom psykologisk behandling behandlar barn och ungdomar med psykisk ohälsa och psykisk sjukdom. Psykologisk behandling är ett paraplybegrepp för en rad interventioner baserade på psykologisk teori och kan utgöras av t.ex. motiverande samtal, problemorienterade samtal, beteendeträning etc. Inom verksamheten kan även utredningar med hjälp av psykologiska testinstrument utföras.', now(), now(), 'DB Import', 'DB Import', 1),
