    ('0191c6e8-e8cb-75f7-b6fd-a0d06f4f6488', '1036', 'Hem för vård eller boende för barn och ungdomar, verksamhet', 'Hem för vård eller boende för barn och ungdomar, verksamhet', 'Verksamhet i ett boende där man tillhandahåller platser för heldygnsvistelse tillsammans med insatser i form av vård eller behandling för barn och ungdomar.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8cb-7c95-bf4c-a2786d67fa98', '1037', 'Särskilt ungdomshem, verksamhet', 'Särskilt ungdomshem, verksamhet', 'Verksamhet i ett boende där man tillhandahåller platser för heldygnsvistelse tillsammans med insatser i form av tvångsvård av barn och ungdomar som behöver stå under särskilt noggrann tillsyn enligt lagen (1990:52) med särskilda bestämmelser om vård av unga, LVU.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8cb-7e06-a7da-215cfa4200bc', '1038', 'Avancerad andningsvård, barn och ungdom', 'Avancerad andningsvård, barn och ungdom', 'Verksamhet där man erbjuder andningsunderstöd i form av t.ex. CPAP och respirator till barn och ungdomar med svåra, långvariga andningsproblem. Inom verksamheten erbjuds även utbildning i exempelvis respiratorvård och skötsel av trakealkanyl för patienten, anhöriga och personal i patientens hemmiljö.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8cb-737c-8822-e2cafd7875b0', '1039', 'Kokleaverksamhet, barn och ungdom, NHV ', 'Kokleaverksamhet, barn och ungdom, NHV ', '\"Verksamhet där man erbjuder barn och ungdomar utredning, operation, anpassning och uppföljning av kokleaimplantat och för detta har Socialstyrelsens tillstånd att bedriva nationellt högspecialiserad vård, NHV. Med nationell högspecialiserad vård menas offentligt finansierad vård som bedrivs vid som mest fem enheter i landet och där endast ett fåtal vårdgivare i landet kan uppfylla kraven på kompetens, tillgänglighet och arbete i multidisciplinära team. Detta benämndes tidigare ”rikssjukvård”.   \"', now(), now(), 'DB Import', 'DB Import', 1),
