    ('0191c6e8-e8cc-74cd-811f-fb15f6bb21b5', '1163', 'Diagnostisk verksamhet vid oklar, allvarlig sjukdom', 'Diagnostisk verksamhet vid oklar, allvarlig sjukdom', 'Verksamhet där man erbjuder utredning till personer där det finns misstanke om cancer eller annan allvarlig sjukdom utan symtom från någon särskild del av kroppen och där en basal utredning inte visat någon säker diagnos. Verksamheten kan utgöra remissinstans för både primärvård och specialiserad vård.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8cc-7618-86ab-0aadd4db5c1c', '1164', 'Sprututbytesverksamhet', 'Sprututbytesverksamhet', 'Verksamhet där man erbjuder personer med intravenöst missbruk möjlighet att lämna gamla sprutor och kanyler i utbyte mot sterila verktyg med syftet att förhindra spridning av blodsmitta. Inom verksamheten erbjuds exempelvis provtagning, vaccination och stödjande samtal.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8cc-712d-95ce-f5b434b7d851', '1165', 'Hjärtsviktsverksamhet, specialiserad vård ', 'Hjärtsviktsverksamhet, specialiserad vård ', '\"Verksamhet där man handlägger patienter med hjärtsvikt. Verksamheten bedrivs inom specialiserad vård och utgör ofta remissinstans för primärvården. Verksamheten kan bedrivas i sluten eller öppen vård. I öppen vård bedrivs den teambaserat och med sjuksköterska som har delegering att dosjustera läkemedel ordinerade för hjärtsvikt.\"', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8cc-7873-a69d-322ece792386', '1166', 'Tobaksavvänjning, primärvård', 'Tobaksavvänjning, primärvård', ' Verksamhet inom primärvård där man erbjuder rådgivning och stöd för personer som vill sluta röka eller snusa.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8cc-745d-814b-2116b647d3d2', '1167', 'Trafikmedicin', 'Trafikmedicin', 'Verksamhet där man utreder lämplighet att framföra körkortspliktigt fordon för fortsatt bilkörning eller utfärdande av körkortstillstånd vid sjukdom eller skada. Det kan avse demens, stroke, drog- eller alkoholrelaterade tillstånd eller neuropsykiatrisk sjukdom. Utredningen utförs ofta i ett multiprofessionellt team.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8cc-74b8-9879-d55c6d561b3c', '1168', 'Sårverksamhet', 'Sårverksamhet', 'Verksamhet där man erbjuder bedömning, rådgivning och behandling till personer med svårläkta sår. Det kan röra sig om bensår, trycksår eller fotsår.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e8-e8cc-7edf-a605-4a1c0a74b3d7', '1169', 'Observationsverksamhet', 'Observationsverksamhet', 'Verksamhet där man tar emot patienter som sökt till akutmottagning och vars medicinska tillstånd kräver längre observationstid, men som samtidigt inte kräver vård på vårdavdelning. Observationstiden kan variera, men ofta överstiger den inte ett dygn.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b667-776e-b0c6-a5d3ea774dca', '1170', 'Postcovidverksamhet', 'Postcovidverksamhet', 'Verksamhet där man i ett multidisciplinärt team erbjuder utredning av kvarstående eller sena symtom efter covid-19. Vid behov remitteras patienten vidare till andra sjukvårdande verksamheter. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7f82-9cb4-44b132d19003', '1205', 'Koagulationsverksamhet', 'Koagulationsverksamhet', 'Laboratorieverksamhet där man utför avancerade analyser vid utredning av koagulations- och blödningsrubbningar.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7f8c-90e2-0309990268e4', '1207', 'Klinisk bakteriologi', 'Klinisk bakteriologi', 'Laboratorieverksamhet där man huvudsakligen utför analyser inom bakteriologi, dvs. diagnostisering av sjukdomar med bakteriella orsaker.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-75c6-b0b8-8129ec690f27', '1209', 'Klinisk farmakologi', 'Klinisk farmakologi', 'Verksamhet där man arbetar med läkemedelssäkerhets- och biverkningsfrågor, utreder och besvarar läkemedelsrelaterade frågor samt utför och bedömer resultat av läkemedelsanalyser.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7e7d-8d11-72f719661aa0', '1210', 'Klinisk fysiologi', 'Klinisk fysiologi', 'Verksamhet där man specialiserat sig på att utföra undersökningar i t.ex. andningsorgan, hjärta, kärl, mag-tarmkanal samt urinvägar med hjälp av fysiologiska mätmetoder. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7a2d-b400-1739287c7a71', '1212', 'Klinisk genetik', 'Klinisk genetik', 'Verksamhet där man handlägger genetiskt betingade sjukdomar samt erbjuder genetisk vägledning vid dessa sjukdomar. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7a7a-a273-d0acc874cb16', '1214', 'Klinisk immunologi', 'Klinisk immunologi', 'Laboratorieverksamhet där man specialiserat sig på att utföra diagnostik, utredning och kontroll inom områdena autoimmunitet, immunbrist, allergi och annan överkänslighet samt vävnadstypning av donator och mottagare i samband med transplantation. Vissa av dessa analyser utförs även inom t.ex. klinisk kemi, transfusionsmedicin och klinisk mikrobiologi.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7e85-b44a-63baa1580dab', '1215', 'Klinisk kemi', 'Klinisk kemi', 'Laboratorieverksamhet där man utför mätning och funktionsprover av olika biokemiska substanser och celler i blod, urin, spinalvätska eller andra kroppsvätskor. Även analyser inom hematologi och koagulation genomförs.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-74ad-a3b7-7efb193c4fa2', '1216', 'Klinisk neurofysiologi', 'Klinisk neurofysiologi', 'Verksamhet där man, främst med elektrofysiologisk metod, påvisar och värderar förändringar och funktionsstörningar inom det centrala och perifera nervsystemet, autonoma nervsystemet, muskulaturen och sinnesorganen.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-713f-a040-a87ed08eae6d', '1217', 'Klinisk nutrition', 'Klinisk nutrition', 'Verksamhet där man specialiserat sig på att handlägga nutritionsrelaterade sjukdomstillstånd.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7031-beb8-1bb39535c82a', '1218', 'Klinisk patologi och cytologi', 'Klinisk patologi och cytologi', 'Verksamhet där man undersöker morfologi eller protein- och genuttryck i vävnader eller celler vid varierande sjukliga processer. Inom verksamheten utförs obduktioner av avlidna för att fastställa dödsorsak och för att upptäcka sjukdomar som inte diagnostiserats under livet.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7e45-b327-45ad887c2882', '1219', 'Klinisk virologi', 'Klinisk virologi', 'Laboratorieverksamhet där man huvudsakligen utför analyser inom virologi, dvs. diagnostisering av sjukdomar orsakade av virus.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-796a-840d-77a4b33e971c', '1220', 'Klinisk mikrobiologi', 'Klinisk mikrobiologi', 'Laboratorieverksamhet där man utför analyser inom flera av områdena bakteriologi, virologi, mykologi eller parasitologi utan någon huvudsaklig inriktning. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7e04-905b-f7428335a826', '1222', 'Klinisk mykologi', 'Klinisk mykologi', 'Laboratorieverksamhet där man huvudsakligen utför analyser inom mykologi, dvs. diagnostisering av sjukdomar som orsakas av svampar.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7670-9ae7-e73f0cc9c4e0', '1229', 'Rättsmedicin', 'Rättsmedicin', 'Verksamhet där man utför obduktion och bedömning av kroppsskador vid onaturlig död, t.ex. vid förmodat brott. Inom verksamheten utförs även undersökningar av levande personer vid brottsutredningar.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7505-b09d-030fc2ae26f9', '1230', 'Vävnadstypningsverksamhet', 'Vävnadstypningsverksamhet', 'Laboratorieverksamhet där man specialiserat sig på att t.ex. inför transplantation utföra vävnadstypning, dvs. bestämning av specifika strukturer på cellernas yta.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7095-ba3a-0590d1b5a859', '1232', 'Stamcellsverksamhet', 'Stamcellsverksamhet', 'Laboratorieverksamhet där man tar till vara och bearbetar stamceller.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7d58-ae28-0a48a9894a0a', '1233', 'Rättsgenetik ', 'Rättsgenetik ', 'Verksamhet där man använder immunologiska metoder och DNA-tekniker för personidentifikation, dels i faderskapsärenden, dels för att identifiera en gärningsman med hjälp av t.ex. blod- eller spermafläckar från en brottsplats.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7fdf-8e60-c542aac3d62c', '1234', 'Rättskemi', 'Rättskemi', 'Verksamhet där man på uppdrag av rättsväsendet utför kemiska analyser för att identifiera och mäta halter av gifter, t.ex. alkohol, läkemedel och narkotika i kroppsvätskor eller kroppsdelar från levande eller avlidna personer.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-75f5-a57f-05915d8243af', '1235', 'Blodgivningsverksamhet', 'Blodgivningsverksamhet', 'Verksamhet där insamling, kontroll och förvaring av blod från blodgivare sker.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7a51-9bc2-2d25f1eab171', '1236', 'Transfusionsmedicin', 'Transfusionsmedicin', 'Laboratorieverksamhet där man utför blodgruppserologi och framställer, förvarar samt distribuerar blod och blodkomponenter.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7476-b8ad-bf5f5a451524', '1237', 'Klinisk parasitologi', 'Klinisk parasitologi', 'Laboratorieverksamhet där man huvudsakligen utför analyser inom parasitologi, dvs. diagnostisering av sjukdomar som orsakas av parasiter.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-747a-8597-0ef7913c486f', '1238', 'Provtagningsverksamhet, öppen vård', 'Provtagningsverksamhet, öppen vård', 'Verksamhet inom öppen vård där man erbjuder provtagning och utför analys av vissa tagna prover. Verksamheten kan bedrivas på vårdcentraler och vid provtagningsenheter på sjukhus.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7a3b-8f61-80dfefa79079', '1302', 'Anestesiologi', 'Anestesiologi', 'Verksamhet där man specialiserat sig på att förebygga smärta i samband med kirurgiska ingrepp och under förlossning samt att övervaka och vid behov stödja eller återställa kroppens vitala funktioner under och efter kirurgiska ingrepp, stora skador eller allvarlig sjukdom.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7dbc-b2f1-b0aed3706c58', '1304', 'Audiologi', 'Audiologi', 'Verksamhet där man specialiserat sig på att handlägga sjukdomar i hörsel- och balanssystemet.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7875-b18f-30ba38d2a075', '1305', 'BB-verksamhet', 'BB-verksamhet', 'Verksamhet där man, huvudsakligen på vårdavdelning, vårdar kvinnor före och efter förlossning.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7b90-8630-66586751c877', '1306', 'Brännskadevård, NHV', 'Brännskadevård, NHV', '\"Verksamhet där man specialiserat sig på intensivvård och rehabilitering av patienter med svåra brännskador och för detta har Socialstyrelsens tillstånd att bedriva nationellt högspecialiserad vård, NHV. Med nationell högspecialiserad vård menas offentligt finansierad vård som bedrivs vid som mest fem enheter i landet och där endast ett fåtal vårdgivare i landet kan uppfylla kraven på kompetens, tillgänglighet och arbete i multidisciplinära team. Detta benämndes tidigare ”rikssjukvård”. \"', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-722f-b32a-7d73a0ddc418', '1307', 'Kolorektal kirurgi', 'Kolorektal kirurgi', 'Verksamhet där man kirurgiskt behandlar sjukdomar och skador i tjocktarm, ändtarm och anus. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7e9b-a6ff-016b884d9b62', '1308', 'Endokrin kirurgi', 'Endokrin kirurgi', 'Verksamhet där man kirurgiskt behandlar sjukdomar i sköldkörteln, bisköldkörtlarna, binjurar samt hormonproducerande tumörer i bukspottkörtel och tarm.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7b91-8c69-04eaf59b4b82', '1309', 'Förlossningsverksamhet', 'Förlossningsverksamhet', 'Verksamhet där man vårdar kvinnor under förlossning.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7919-9125-bcbe6fbd36be', '1311', 'Gynekologi', 'Gynekologi', 'Verksamhet där man handlägger sjukdomar och funktionsrubbningar i de kvinnliga reproduktionsorganen. Inom verksamheten handläggs även abort och komplikationer i tidig graviditet. Preventivmedelsrådgivning bedrivs också inom verksamheten.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7a02-bbb3-0f7f016d27ad', '1312', 'Onkologi, gynekologisk', 'Onkologi, gynekologisk', 'Verksamhet där man specialiserat sig på att handlägga gynekologiska tumörsjukdomar.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-75ea-a85e-4ca1dc9bf443', '1313', 'Handkirurgi', 'Handkirurgi', 'Verksamhet där man kirurgiskt behandlar sjukdomar och skador i handen och underarmen.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7605-ac3c-876ea5072b2f', '1314', 'Idrottsmedicin', 'Idrottsmedicin', 'Verksamhet där man handlägger idrottsrelaterade skador. Verksamheten inkluderar även rehabilitering, rådgivning och förebyggande insatser inom området.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7455-b188-b20a88a9ef1d', '1315', 'Kirurgi', 'Kirurgi', 'Verksamhet där man kirurgiskt behandlar sjukdomar och skador i bukhålans organ, i bröst, hud och underhud samt endokrina körtlar på hals och i bukhålan.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7dc9-b748-462a3d897cb8', '1316', 'Kärlkirurgi', 'Kärlkirurgi', 'Verksamhet där man kirurgiskt behandlar sjukdomar i kärlsystemet utanför hjärtat och skallen. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-72c4-9dfb-eecb499c38a4', '1318', 'Neurokirurgi', 'Neurokirurgi', 'Verksamhet där man kirurgiskt behandlar sjukdomar och skador i hjärna, ryggmärg och perifera nerver.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-78c2-9fe2-a70795c720aa', '1324', 'Ortopedi', 'Ortopedi', 'Verksamhet där man kirurgiskt eller medicinskt behandlar rörelseorganens sjukdomar och skador.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-71b2-a4b5-86eb3c0ec2a9', '1325', 'Ortoptik', 'Ortoptik', 'Verksamhet där man behandlar skelning och annan bristande samordning av ögonens seende och rörelse.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7cc7-9227-02e4ffdaab61', '1328', 'Smärtbehandlingsverksamhet, akut smärta', 'Smärtbehandlingsverksamhet, akut smärta', 'Verksamhet där man specialiserat sig på att erbjuda rådgivning om och uppföljning av behandling av akut smärta, t.ex. i samband med trauma, kirurgiska ingrepp eller smärta vid medicinska tillstånd.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-74a5-99e3-0a5473b6c35b', '1329', 'Thoraxkirurgi', 'Thoraxkirurgi', 'Verksamhet där man kirurgiskt behandlar sjukdomar och skador i bröstkorgen och de organ belägna där, t.ex. hjärta, lungor och de stora kärlen.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-78f6-8b83-d0d437751e11', '1330', 'Transplantationsverksamhet', 'Transplantationsverksamhet', 'Verksamhet där man utför transplantation av t.ex. njure, lever, hjärta, bukspottkörtel, cellöar och benmärg.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7c35-b498-5b0c59c51c39', '1332', 'Urologi', 'Urologi', 'Verksamhet där man kirurgiskt eller medicinskt behandlar njurarnas, urinvägarnas och de manliga könsorganens sjukdomar samt behandlar manlig ofruktsamhet och potensrubbningar.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7b92-bd6c-533e7da16763', '1333', 'Öron-, näs- och halssjukvård', 'Öron-, näs- och halssjukvård', 'Verksamhet där man handlägger sjukdomar, trauman, missbildningar och funktionsrubbningar i öron-, näs- och halsregionen.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-72a4-9e8a-5688392afb47', '1334', 'Foniatri', 'Foniatri', 'Verksamhet där man specialiserat sig på att handlägga rubbningar i röst-, tal- och språkfunktioner, sväljningsproblem med tonvikt på motorikstörningar i munhåla och svalg samt larynxrelaterade andningshinder.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7e09-becd-7981d4986682', '1335', 'Ögonsjukvård', 'Ögonsjukvård', 'Verksamhet där man handlägger ögonsjukdomar.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7387-9e09-292c7b44294c', '1336', 'Bröstmottagning, verksamhet', 'Bröstmottagning, verksamhet', 'Verksamhet där man undersöker patienter som har symtom från sina bröst, vanligen en upptäckt knöl i bröstet. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7920-b4c4-70bcb5de3d7d', '1340', 'Reproduktionsmedicin', 'Reproduktionsmedicin', 'Verksamhet där man specialiserat sig på att utreda och behandla patienter med ofrivillig barnlöshet. Inom verksamheten utförs även IVF-behandling.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7d6f-a641-243601d01201', '1343', 'Överviktsvård', 'Överviktsvård', 'Verksamhet där man specialiserat sig på att behandla patienter med fetma i olika grader.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7736-bc7d-82b3f2ef77fd', '1344', 'Övre gastroenterologisk kirurgi', 'Övre gastroenterologisk kirurgi', 'Verksamhet där man kirurgiskt behandlar sjukdomar och skador i matstrupe, magsäck, tunntarm, galla, lever eller bukspottkörtel.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7186-adbe-7c279e7968e3', '1345', 'Rekonstruktiv plastikkirurgi', 'Rekonstruktiv plastikkirurgi', 'Verksamhet där man specialiserat sig på att kirurgiskt behandla yttre medfödda missbildningar, förvärvade yttre defekter orsakade av tumörer, skador eller andra förändringar i hud, slemhinnor och stödjevävnad.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7b26-8103-d56f06f74c63', '1346', 'Estetisk plastikkirurgi', 'Estetisk plastikkirurgi', 'Verksamhet där man specialiserat sig på att kirurgiskt korrigera tillstånd uppkomna genom normala åldersförändringar, eller som orsakas av en önskan om förändring av utseendet.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-74d6-94e8-ac8522a50b9d', '1347', 'Akutverksamhet vid sjukhus, ortopedi', 'Akutverksamhet vid sjukhus, ortopedi', 'Verksamhet där man dygnet runt erbjuder specialiserad medicinsk bedömning och behandling av akuta ortopediska sjukdomstillstånd med stöd av sjukhusets medicinska och tekniska resurser.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7b1f-8350-759d4465fd11', '1348', 'Akutverksamhet vid sjukhus, gynekologi ', 'Akutverksamhet vid sjukhus, gynekologi ', 'Verksamhet där man dygnet runt erbjuder specialiserad medicinsk bedömning och behandling av akuta gynekologiska sjukdomstillstånd med stöd av sjukhusets medicinska och tekniska resurser.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7977-8ff9-581471ac44c0', '1349', 'Akutverksamhet vid sjukhus, kirurgi', 'Akutverksamhet vid sjukhus, kirurgi', 'Verksamhet där man dygnet runt erbjuder specialiserad medicinsk bedömning och behandling av akuta kirurgiska sjukdomstillstånd med stöd av sjukhusets medicinska och tekniska resurser.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-71aa-9221-8b104fc31393', '1350', 'Akutverksamhet vid sjukhus, sexuellt våldsutsatta', 'Akutverksamhet vid sjukhus, sexuellt våldsutsatta', 'Verksamhet där man, med stöd av sjukhusets medicinska och tekniska resurser, dygnet runt kan erbjuda specialiserad medicinsk bedömning och behandling av personer som blivit sexuellt våldsutsatta.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-73e6-b3a4-6706801b8ecd', '1351', 'Akutverksamhet vid sjukhus, ögonsjukvård', 'Akutverksamhet vid sjukhus, ögonsjukvård', 'Verksamhet där man oftast dygnet runt erbjuder specialiserad medicinsk bedömning och behandling av akuta sjukdomstillstånd i ögonregionen med stöd av sjukhusets medicinska och tekniska resurser.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-73e6-9520-0a550905fa64', '1352', 'Akutverksamhet vid sjukhus, öron-, näs- och halssjukvård', 'Akutverksamhet vid sjukhus, öron-, näs- och halssjukvård', 'Verksamhet där man oftast dygnet runt erbjuder specialiserad medicinsk bedömning och behandling av akuta sjukdomstillstånd i öron-, näs- och halsregionen med stöd av sjukhusets medicinska och tekniska resurser.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-71c1-84d7-de957e2c94f7', '1353', 'Specialistmödravård', 'Specialistmödravård', 'Verksamhet där man handlägger sjukdomar eller tillstånd som medför ökad risk för komplikationer under graviditet eller förlossning.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7376-90ff-24ba5d91445b', '1354', 'Amningsmottagning, verksamhet', 'Amningsmottagning, verksamhet', 'Verksamhet där man specialiserat sig på att erbjuda hjälp och stöd till kvinnor med amningssvårigheter.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7df7-bd76-61d243482997', '1355', 'Ultraljudsverksamhet, gynekologisk', 'Ultraljudsverksamhet, gynekologisk', 'Verksamhet där man specialiserat sig på att utföra gynekologiska ultraljudsundersökningar.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-760b-acff-8366ee9ac675', '1356', 'BB-hemvård', 'BB-hemvård', 'Verksamhet där man erbjuder nyförlösta kvinnor hjälp och stöd efter hemkomsten från BB. Verksamheten erbjuder t.ex. mottagnings- och hembesök, besök till barnläkare, provtagning samt amningshjälp.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7456-8a3c-dcc34c91bec8', '1357', 'Bäckenbottenverksamhet', 'Bäckenbottenverksamhet', 'Verksamhet där man teambaserat erbjuder bedömning, utredning och behandling av skada eller sjukdom i bäckenbotten, t.ex. förlossningsskador, framfall och fistlar. Verksamheten bedrivs multiprofessionellt och genom samarbete mellan flera specialistläkarkompetenser samt utgör remissinstans för både primärvård och specialiserad vård.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-77c8-9e96-ebdcc2e521c3', '1358', 'Uroterapi', 'Uroterapi', 'Verksamhet inom specialiserad vård där man, ofta teambaserat, erbjuder utredning, behandling och rådgivning till personer med bl.a. urininkontinens, blåstömningsbesvär och trängningsproblematik. Rådgivningen innebär patientundervisning i form av t.ex. träningsprogram och hjälp att hitta sätt att hantera sina besvär.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-78b8-a690-8e2de51a9000', '1359', 'Ryggkirurgi', 'Ryggkirurgi', 'Verksamhet där man kirurgiskt eller medicinskt bedömer och behandlar sjukdomar och skador i rygg och nacke.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7fab-82f5-c3fa1894e94d', '1360', 'Ultraljudsverksamhet, obstetrisk', 'Ultraljudsverksamhet, obstetrisk', 'Verksamhet där man specialiserat sig på att utföra ultraljudsundersökningar under graviditet.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7104-be27-71e74e4e41c3', '1361', 'Ögononkologi, NHV', 'Ögononkologi, NHV', '\"Verksamhet där man handlägger tumörer i ögon och för detta har Socialstyrelsens tillstånd att bedriva nationellt högspecialiserad vård, NHV. Med nationell högspecialiserad vård menas offentligt finansierad vård som bedrivs vid som mest fem enheter i landet och där endast ett fåtal vårdgivare i landet kan uppfylla kraven på kompetens, tillgänglighet och arbete i multidisciplinära team. Detta benämndes tidigare ”rikssjukvård”. \"', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-723e-a18c-57b9b022acc4', '1362', 'Avancerad andningsvård, vuxna', 'Avancerad andningsvård, vuxna', 'Verksamhet där man erbjuder andningsunderstöd i form av t.ex. CPAP och respirator till vuxna med svåra, långvariga andningsproblem. Inom verksamheten erbjuds även utbildning i exempelvis respiratorvård och skötsel av trakealkanyl för patienten, anhöriga och personal i patientens hemmiljö.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7ea8-8e58-1741e5071cb3', '1363', 'Stomiverksamhet, specialiserad vård', 'Stomiverksamhet, specialiserad vård', 'Verksamhet där man handlägger patienter med stomi. Verksamheten bedrivs inom specialiserad vård och utgör ofta remissinstans för primärvården.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7667-88a4-7c6e3a127252', '1364', 'Malign hypertermi-verksamhet', 'Malign hypertermi-verksamhet', 'Verksamhet där man erbjuder utredning till personer vid misstanke om malign hypertermi.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7f47-ba71-54eed653d4b7', '1365', 'Kokleaverksamhet ', 'Kokleaverksamhet ', 'Verksamhet där man erbjuder exempelvis utredning, operation, anpassning och uppföljning av kokleaimplantat. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-74c8-9dfd-5294b30c9ca4', '1366', 'Fosterterapi, NHV ', 'Fosterterapi, NHV ', '\"Verksamhet där man utför intrauterina ingrepp för att behandla foster och för detta har Socialstyrelsens tillstånd att bedriva nationell högspecialiserad vård, NHV. Med nationell högspecialiserad vård menas offentligt finansierad vård som bedrivs vid som mest fem enheter i landet och där endast ett fåtal vårdgivare i landet kan uppfylla kraven på kompetens, tillgänglighet och arbete i multidisciplinära team. Detta benämndes tidigare ”rikssjukvård”.\"', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-75cc-8534-9044d72571d1', '1367', 'Centraloperation', 'Centraloperation', 'Verksamhet där man planerar, samordnar och utför operationer inom olika kirurgiska områden.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7a0d-984b-babff73f42ab', '1368', 'Endometriosverksamhet, NHV', 'Endometriosverksamhet, NHV', '\"Verksamhet där man erbjuder utredning och behandling av patienter med komplicerad endometrios och för detta har Socialstyrelsens tillstånd att bedriva nationell högspecialiserad vård, NHV. Med nationell högspecialiserad vård menas offentligt finansierad vård som bedrivs vid som mest fem enheter i landet och där endast ett fåtal vårdgivare i landet kan uppfylla kraven på kompetens, tillgänglighet och arbete i multidisciplinära team. Detta benämndes tidigare ”rikssjukvård”.\"', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7f02-a08d-9980d22b00a2', '1402', 'Arbetsterapi', 'Arbetsterapi', 'Verksamhet där man arbetar med att uppnå eller bibehålla bästa möjliga aktivitetsförmåga hos personer med funktionsnedsättning efter skada eller sjukdom. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-72f4-9055-15bb7a95732a', '1403', 'Dietistverksamhet', 'Dietistverksamhet', 'Verksamhet där man bedriver kost- och nutritionsbehandling.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7653-9b0f-1dd9c229de94', '1404', 'Habilitering, vuxna ', 'Habilitering, vuxna ', 'Verksamhet där man specialiserat sig på att erbjuda habilitering med medicinska, psykosociala och pedagogiska insatser för vuxna med medfödd eller tidigt förvärvad funktionsnedsättning.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-75e1-a6e6-1fecca0d1904', '1406', 'Kiropraktik', 'Kiropraktik', 'Verksamhet där man behandlar funktionella störningar och smärttillstånd i leder och muskler med hjälp av speciell manuell behandling.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-77eb-9939-66199f999d2f', '1407', 'Kuratorsverksamhet', 'Kuratorsverksamhet', 'Verksamhet där man erbjuder patienter utredning, planering, rådgivning samt krisbehandling för problem av psykisk, familjesocial och praktisk-ekonomisk natur.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7c2f-854c-c6ce755c2374', '1408', 'Logopedi', 'Logopedi', 'Verksamhet där man med pedagogiska metoder behandlar röst-, tal- och språkrubbningar samt sväljningsproblem.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7bf1-872a-c22ecc51af9d', '1409', 'Naprapati', 'Naprapati', 'Verksamhet där man behandlar funktionella störningar och smärttillstånd i både skelett och mjukdelar med hjälp av manuell behandling i form av t.ex. manipulation, massage och värmebehandling. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-77d0-ae0c-befbfba13ad7', '1410', 'Optikerverksamhet', 'Optikerverksamhet', 'Verksamhet där man undersöker synfunktionen och utprovar optiska synhjälpmedel samt genomför ögonhälsoundersökningar.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7073-bb9c-bf56c37a20a7', '1411', 'Psykologverksamhet, vuxna', 'Psykologverksamhet, vuxna', 'Verksamhet där man genom psykologisk behandling behandlar vuxna med psykisk ohälsa och psykisk sjukdom. Psykologisk behandling är ett paraplybegrepp för en rad inter-ventioner baserade på psykologisk teori och kan utgöras av t.ex. motiverande samtal, problemorienterade samtal, beteendeträning etc. Inom verksamheten kan även utredningar med hjälp av psykologiska testinstrument utföras.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7e2a-b4c1-7293016d3f80', '1412', 'Psykoterapi, vuxna', 'Psykoterapi, vuxna', 'Verksamhet där man genom psykoterapeutisk samtalsmetod behandlar vuxna med psykisk ohälsa och psykisk sjukdom. Psykoterapi är ett paraplybegrepp för samtalsmetoder baserade på en eller flera teoretiska inriktningar.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-772f-b37e-8a704c75f08c', '1413', 'Sjukgymnastik/Fysioterapi', 'Sjukgymnastik/Fysioterapi', 'Verksamhet där man bedriver rörelse-, styrke- och koordinationsträning. Inom verksamheten behandlas även t.ex. andningssvårigheter, olika smärttillstånd och vissa psykiska problem.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7b24-b832-c53fb5276793', '1414', 'Artrosskola', 'Artrosskola', 'Verksamhet där man erbjuder personer med artros information och rådgivning om sjukdomen och hur man kan hantera den, t.ex. i form av egenvårdstips och träningsprogram.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7cdf-af1d-032ef0eb7370', '1415', 'Audionomverksamhet', 'Audionomverksamhet', 'Verksamhet där audionom bedriver hörseldiagnostik och hörselrehabilitering samt tillhandahåller och provar ut olika hörselhjälpmedel, t.ex. hörapparater. Verksamheten bedrivs ofta, men inte alltid, i privat regi.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-790a-8038-42d44c5e08bf', '1416', 'Sexologisk verksamhet', 'Sexologisk verksamhet', 'Verksamhet där man erbjuder rådgivning och behandling vid frågor eller problem som rör sexuell lust, potens, orgasm, samlagssmärta och sexuell identitet.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7ea0-a1df-5c2c94c78907', '1417', 'Psykologverksamhet, mödra- och barnhälsovård', 'Psykologverksamhet, mödra- och barnhälsovård', 'Verksamhet där man arbetar med att förebygga psykisk ohälsa hos blivande föräldrar och familjer med barn i förskoleåldern. Verksamheten erbjuder bland annat rådgivning till föräldrar, psykologiska behandlingsinsatser och psykologiska bedömningar av barn. I verksamhetens uppdrag ingår ofta att ge information och fortbildning till personal inom övrig mödra- och barnhälsovård.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-72a6-8027-cb5cd16e7f38', '1500', 'Akutverksamhet med basåtagande i primärvård', 'Akutverksamhet med basåtagande i primärvård', '\"Verksamhet med basåtagande i primärvård där man, framför allt under icke ordinarie arbetstid, erbjuder grundläggande medicinsk bedömning, behandling och omvårdnad till personer med akuta sjukdomstillstånd. Inom verksamheten har man inte tillgång till sjukhusens medicinska och tekniska resurser. Inom verksamheten bedömer man även behov av remiss till andra verksamheter. Verksamheten kan erbjuda både mottagnings- och hembesök.\"', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7425-a771-1aa6d3856fd0', '1502', 'Allmänmedicin', 'Allmänmedicin', 'Verksamhet där man handlägger alla sorters hälsorelaterade problem hos människor i alla åldrar samt bedömer behov av remiss till andra specialiteter. Verksamheten bedrivs i öppen vård eller hemsjukvård och inkluderar även förebyggande och rehabiliterande arbete.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7169-a304-92c11ae9c566', '1504', 'Barnhälsovård/BVC', 'Barnhälsovård/BVC', 'Verksamhet där man arbetar med att förebygga, tidigt upptäcka och behandla sjukdomar och andra hälsoproblem hos barn mellan 0 och 5 år. Barnhälsovården genomför bland annat regelbundna hälsokontroller, hälsoupplysning, vaccinationer, hembesök och föräldrautbildning. Verksamheten bedrivs på barnavårdscentraler, BVC. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-71b7-b8b9-c6f09b341b88', '1505', 'Barnmorskeverksamhet', 'Barnmorskeverksamhet', 'Verksamhet där man bedriver förebyggande hälsovård för kvinnor i samband med graviditet samt föräldrautbildning, gynekologisk cellprovskontroll och preventivmedelsrådgivning. Verksamheten bedrivs även vid mödravårdscentraler (MVC). ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-79c0-821a-8df92981bb0c', '1506', 'Distriktssköterskeverksamhet', 'Distriktssköterskeverksamhet', 'Verksamhet där distriktssköterska eller sjuksköterska bedömer behov av, genomför och följer upp medicinska och omvårdande åtgärder samt erbjuder rådgivning och förebyggande hälsovård. Verksamheten bedrivs vid t.ex. distriktssköterskemottagningar på vårdcentraler. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-74d6-a86a-61c3b0836040', '1508', 'Företagshälsovård', 'Företagshälsovård', 'Verksamhet där man arbetar med att förebygga och undanröja hälsorisker på arbetsplatsen samt att identifiera och beskriva sambanden mellan arbetsmiljö, organisation, produktivitet och hälsa. Företagshälsovården arbetar också med hälsokontroller, arbetsanpassning och rehabilitering samt sjukvård i begränsad omfattning.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7380-8099-432d7bfe7d46', '1509', 'Läkarverksamhet, särskilt boende', 'Läkarverksamhet, särskilt boende', 'Verksamhet där man erbjuder hälso- och sjukvård till personer som bor i särskilt boende. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7813-a864-db60a4a81aab', '1516', 'Primärvårdsrehabilitering', 'Primärvårdsrehabilitering', 'Verksamhet inom primärvård där man erbjuder rehabilitering för patienter som inte har behov av den specialiserade vårdens rehabiliteringsresurser. Primärvårdsrehabilitering kan bedrivas i öppen vård och hemsjukvård.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7ec5-9367-1862bf7a9549', '1517', 'Skolhälsovård', 'Skolhälsovård', 'Verksamhet inom elevhälsan där man bedriver förebyggande hälsovård, och viss sjukvård, för barn och ungdomar från skolstarten till och med gymnasiet. Hälsovården omfattar bland annat vaccinationer, kurativ vård, psykosocial rådgivning, förebyggande arbete (t.ex. rådgivning om alkohol och tobak) samt sex- och samlevnadsrådgivning.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7c4a-9cf6-a04807922ed1', '1519', 'Ungdomsmottagning, verksamhet', 'Ungdomsmottagning, verksamhet', 'Verksamhet som riktar sig till tonåringar och unga vuxna där man bedriver rådgivning om sex och samlevnad, preventivmedel och psykosocial hälsa samt utreder och behandlar sexuellt överförbara sjukdomar.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7012-abe0-aa6e86a14451', '1521', 'Flyktingmedicin', 'Flyktingmedicin', 'Verksamhet där man erbjuder nyanlända flyktingar hälsoundersökning och uppföljning av hälsoproblem med t.ex. läkarbesök.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7d3f-85b8-10b5b3246cd6', '1522', 'Akutverksamhet utan basåtagande i primärvård', 'Akutverksamhet utan basåtagande i primärvård', '\"Verksamhet utan basåtagande i primärvård där man under alla dagar, dag- och kvällstid, erbjuder medicinsk bedömning och behandling till personer med akuta sjukdomstillstånd. Inom verksamheten har man tillgång till vissa medicinska och tekniska resurser, t.ex. röntgen och ambulansintag, och även till konsultationsinsatser från andra specialistområden. Ibland används benämningen närakut för denna verksamhet, men observera att det även används för liknande verksamheter i primärvården. \"', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7ac4-a118-bb361798856e', '1600', 'Akutverksamhet vid sjukhus, vuxenpsykiatri', 'Akutverksamhet vid sjukhus, vuxenpsykiatri', 'Verksamhet där man dygnet runt erbjuder vuxna specialiserad medicinsk bedömning och behandling av akuta psykiatriska sjukdomstillstånd med stöd av sjukhusets medicinska och tekniska resurser.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7570-ac71-516aa8c1c7dd', '1603', 'Alkoholsjukvård', 'Alkoholsjukvård', 'Verksamhet där man specialiserat sig på att handlägga alkoholrelaterade tillstånd och problem.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7cc8-8eae-78790e80be9b', '1604', 'Allmänpsykiatri, vuxna', 'Allmänpsykiatri, vuxna', 'Verksamhet där man hos vuxna handlägger psykiska sjukdomar som inte handläggs inom annan specialiserad psykiatrisk verksamhet eller ingår i primärvårdens uppdrag.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-77a1-8b23-cb0a16f1485f', '1605', 'Dövpsykiatri', 'Dövpsykiatri', 'Verksamhet där man specialiserat sig på att handlägga psykiska sjukdomar hos döva och hörselskadade.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7af3-872b-a0865b6aa056', '1606', 'Familjebehandlingsverksamhet', 'Familjebehandlingsverksamhet', 'Verksamhet där man specialiserat sig på att handlägga psykisk sjukdom hos en person genom att involvera personens familj eller närstående i behandlingen.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-72f2-82a3-694b62012944', '1607', 'Äldrepsykiatri', 'Äldrepsykiatri', 'Verksamhet där man specialiserat sig på att handlägga psykiska sjukdomar hos äldre. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7fe9-9fd6-2b4add52ef63', '1609', 'Narkomanisjukvård ', 'Narkomanisjukvård ', 'Verksamhet där man specialiserat sig på att handlägga narkotikarelaterade tillstånd och problem.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7e2c-a596-f3b852528808', '1614', 'Rättspsykiatrisk vård', 'Rättspsykiatrisk vård', 'Verksamhet där man vårdar personer som i domstol dömts till rättspsykiatrisk vård.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7881-a58e-8a6abc1f8562', '1615', 'Rättspsykiatriska undersökningar, RMV', 'Rättspsykiatriska undersökningar, RMV', 'Verksamhet där man utför rättspsykiatriska undersökningar på begäran av domstol. Rättspsykiatriska undersökningar utförs av Rättsmedicinalverket, RMV.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-73e4-b08e-4a6ac0f86c72', '1618', 'Läkemedelsberoendevård', 'Läkemedelsberoendevård', 'Verksamhet där man specialiserat sig på att handlägga läkemedelsberoende. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7b12-867e-8b71d04aeab7', '1619', 'Psykosvård', 'Psykosvård', 'Verksamhet där man specialiserat sig på att handlägga psykossjukdomar.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-72fa-996f-f5b98fe81b54', '1620', 'Akutverksamhet, psykiatriska jourteam', 'Akutverksamhet, psykiatriska jourteam', 'Verksamhet inom öppen vård där man, framför allt under kvällar, nätter och helger, erbjuder specialiserad medicinsk bedömning och behandling av akuta psykiska sjukdomstillstånd och där man inte har tillgång till sjukhusens medicinska och tekniska resurser. ', now(), now(), 'DB Import', 'DB Import', 1),
