    ('0191c6e9-b668-7795-9b0d-ccea05c5bf01', '1625', 'Ätstörningsvård, vuxna', 'Ätstörningsvård, vuxna', 'Verksamhet där man hos vuxna specialiserat sig på att handlägga ätstörningar.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7f8d-8cfb-7d28005b658a', '1626', 'Psykiatri, vuxna', 'Psykiatri, vuxna', 'Verksamhet där man där man hos vuxna handlägger psykiska sjukdomar, som inte ingår i primärvårdens uppdrag.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7bf6-997e-a5f015cf557e', '1627', 'Stressrehabilitering', 'Stressrehabilitering', 'Verksamhet där man erbjuder behandling och rehabilitering i ett multiprofessionellt team för patienter med stressrelaterad psykisk ohälsa, t.ex. utmattningssyndrom. Stressproblematiken bedöms, utreds, behandlas och rehabiliteras utifrån en integrerad helhetssyn.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7ed5-a146-25a77466a197', '1628', 'Krigs- och tortyrskadevård', 'Krigs- och tortyrskadevård', 'Verksamhet där man erbjuder vård till personer som har traumatiserats av krig och tortyr. Krigs- och tortyrskadeproblematiken bedöms, utreds och behandlas ofta i ett multiprofessionellt team.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7d69-b14b-5a6d0e421a59', '1629', 'Könsdysforiverksamhet, NHV', 'Könsdysforiverksamhet, NHV', '\"Verksamhet där man erbjuder utredning av patienter med misstänkt könsdysfori och bedömer behov av och beslutar om utförande av könsbekräftande behandling. För detta har verksamheten Socialstyrelsens tillstånd att bedriva nationell högspecialiserad vård, NHV. Med nationell högspecialiserad vård menas offentligt finansierad vård som bedrivs vid som mest fem enheter i landet och där endast ett fåtal vårdgivare i landet kan uppfylla kraven på kompetens, tillgänglighet och arbete i multidisciplinära team. Detta benämndes tidigare ”rikssjukvård”.\"', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-72f2-b43a-d755df9f1091', '1702', 'Datortomografiverksamhet', 'Datortomografiverksamhet', 'Verksamhet där man specialiserat sig på att utföra undersökningar med hjälp av datortomografi, datorbehandlade tomografiska röntgenbilder.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-750f-b791-f9a436a30c51', '1706', 'MR-verksamhet', 'MR-verksamhet', 'Verksamhet där man specialiserat sig på att utföra undersökningar med hjälp av magnetisk resonanstomografi, MR.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-73f4-b8a0-a9b8f2031b76', '1707', 'Mammografi', 'Mammografi', 'Verksamhet där man specialiserat sig på att utföra röntgenundersökningar av brösten hos kvinnor. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-72cc-8fc3-9e9b3129acef', '1708', 'Radiologi', 'Radiologi', 'Verksamhet där man med hjälp av bildgivande morfologiska och funktionella metoder diagnostiserar och behandlar sjukdomar samt utvärderar terapi.Verksamheten kan inkludera en rad olika radiologiska inriktningar, som kärlradiologi, gastrointestinal radiologi och thoraxradiologi. Även verksamhet där man utför undersökningar med hjälp av ultraljud, MR och PET m.m. kan innefattas.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7f10-985b-35e85eec58c0', '1709', 'Nuklearmedicin', 'Nuklearmedicin', 'Verksamhet där man diagnostiserar och utför behandlingskontroll med hjälp av radionuklider som förts in i kroppen och som ger information via bilder eller genom registrering av dynamiska förlopp.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7884-b321-51d226bb98b9', '1710', 'Neuroradiologi', 'Neuroradiologi', 'Verksamhet där man med bildgivande metoder diagnostiserar och behandlar sjukdomar inom det central nervsystemet och öron-, näs- och halsområdet.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7637-a121-21ba00a41ec2', '1715', 'Strålbehandlingsverksamhet', 'Strålbehandlingsverksamhet', 'Verksamhet där man använder joniserande strålning vid sjukdomsbehandling, främst behandling mot tumörsjukdom.', now(), now(), 'DB Import', 'DB Import', 1),
