    ('0191c6e9-b668-7a26-ba25-9592013cc0f5', '1721', 'Ultraljudsverksamhet', 'Ultraljudsverksamhet', 'Verksamhet där man specialiserat sig på att utföra undersökningar med hjälp av ultraljud.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7b3e-8dab-d866ce6ca7a1', '1801', 'Akutverksamhet, allmäntandvård', 'Akutverksamhet, allmäntandvård', 'Verksamhet där man, framför allt under icke ordinarie arbetstid, handlägger akuta besvär i tänder och munhåla.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7fa2-8661-326a26c99817', '1802', 'Allmäntandvård', 'Allmäntandvård', 'Verksamhet där man huvudsakligen bedriver bastandvård, dvs. genomför grundläggande undersökning samt förebyggande och reparativ behandling av befintliga tänder. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7f9b-99ca-ef72e6f1400c', '1803', 'Tandhygienistverksamhet', 'Tandhygienistverksamhet', 'Verksamhet där man diagnostiserar karies och parodontit samt behandlar och förebygger tand- och munsjukdomar. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-715d-8764-79ff5cd67002', '1804', 'Pedodonti', 'Pedodonti', 'Verksamhet där man handlägger orala problem hos barn och ungdomar med särskilda behov, t.ex. barn med svår tandvårdsrädsla, med funktionsnedsättningar, med tandutvecklingsstörning eller barn med komplicerade tandolycksfall.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7fdc-afd5-aaf5a6c9836e', '1805', 'Bettfysiologi', 'Bettfysiologi', 'Verksamhet där man handlägger störningar och smärttillstånd i bett- och tuggsystemet.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-78d8-b388-6e05cfce1f41', '1806', 'Endodonti', 'Endodonti', 'Verksamhet där man handlägger sjukdomar och skador i tandens pulpa och angränsande käkben.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b668-7e10-b924-6cc40309231c', '1807', 'Käkkirurgi', 'Käkkirurgi', 'Verksamhet där man handlägger och kirurgiskt behandlar sjukdomar, medfödda missbildningar och förvärvade defekter i munhåla, käkar, ansikte samt angränsande områden. Verksamheten benämns även oral kirurgi.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7bdd-8bd1-7eb6bdc49086', '1808', 'Odontologisk radiologi', 'Odontologisk radiologi', 'Verksamhet där man röntgar tänder och käkar samt angränsande organ och strukturer. Inom verksamheten används även ultraljud och magnetisk resonanstomografi. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7735-a6f4-2f8239090054', '1809', 'Oral protetik', 'Oral protetik', 'Verksamhet där man rekonstruerar eller ersätter tänder och vävnader (tandkött och käkben) med fasta och avtagbara proteser samt genom implantat. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7067-aab6-c2295c1d4cce', '1810', 'Ortodonti', 'Ortodonti', 'Verksamhet där man handlägger bett- och käkavvikelser, t.ex. genom tandreglering för att behandla uttalade felställningar av tänder och bettförhållanden.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-78a9-8df0-05ec1b417084', '1811', 'Parodontologi', 'Parodontologi', 'Verksamhet där man handlägger tandlossningssjukdomar.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7007-9e24-2fcba7543d17', '1812', 'Akutverksamhet vid sjukhus, käkkirurgi', 'Akutverksamhet vid sjukhus, käkkirurgi', 'Verksamhet där man dygnet runt erbjuder specialiserad medicinsk bedömning och behandling av akuta käkkirurgiska sjukdomstillstånd med stöd av sjukhusets medicinska och tekniska resurser.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7e41-9bde-8a7f46b5f4de', '1813', 'Orofacial medicin', 'Orofacial medicin', 'Verksamhet där man handlägger orofaciala tillstånd hos vuxna som behöver ett särskilt omhändertagande, t.ex. på grund av systemsjukdomar, funktionsnedsättning eller psykisk ohälsa. Verksamheten utgör remissinstans för bl.a. allmäntandvården och kallas ibland även för sjukhustandvård eller oral medicin', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7b0c-92e3-8e34137d7ff9', '2003', 'Medicinsk fotvård', 'Medicinsk fotvård', 'Verksamhet där man förebygger och behandlar förändringar i hud och naglar på fötterna hos personer med sjukdomar som t.ex. diabetes eller ledgångsreumatism.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7b9c-be79-cc696a455904', '2005', 'Hjälpmedelsverksamhet', 'Hjälpmedelsverksamhet', 'Verksamhet där man tillhandahåller hjälpmedel till personer med övergående eller bestående funktionsnedsättning. Inom verksamheten bedrivs även rådgivning och undervisning om hjälpmedel.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7ecb-8cd1-59e7cd9a021e', '2006', 'Hörselcentral, verksamhet', 'Hörselcentral, verksamhet', 'Verksamhet där man bedriver förebyggande hörselvård, hörseldiagnostik och hörselrehabilitering, t.ex. utprovning av hörapparater. Inom verksamheten kan ofta habiliterande insatser, undervisning och fördjupad rehabilitering erbjudas. Ibland används benämningen audionomverksamhet för denna verksamhet, men observera att det finns en annan kod med det namnet.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7a1b-a14b-5370d1f3de05', '2008', 'Medicinsk strålningsfysik', 'Medicinsk strålningsfysik', 'Verksamhet där man arbetar med den joniserande och icke-joniserande strålningens användning inom hälso- och sjukvård. Verksamheten innefattar kvalitetssäkring, kvalitetskontroll, metodutveckling, optimering av undersökningsmetoder, strålskydd och utbildning av personal inom verksamheter som använder strålning.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-774f-ad26-de58c9d1e9c1', '2009', 'Medicinteknisk verksamhet', 'Medicinteknisk verksamhet', 'Verksamhet där man tillhandahåller medicintekniska produkter, t.ex. röntgen- och dialysapparatur, kirurgiska instrument, ortopediska implantat, pacemakrar, katetrar och kanyler. Inom verksamheten bedrivs även underhåll av medicintekniska produkter. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-711b-b814-bc3989985b05', '2011', 'Ortopedteknisk verksamhet', 'Ortopedteknisk verksamhet', 'Verksamhet där man tillverkar och individanpassar ortopedtekniska hjälpmedel som t.ex. proteser, ortoser, korsetter, ortopediska skor och skoinlägg. Inom verksamheten bedrivs även utbildning, såsom gångträning. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-766a-bb14-501da75804f6', '2014', 'Sjuktransportverksamhet', 'Sjuktransportverksamhet', 'Verksamhet där man erbjuder transport till och från vårdenhet för personer vilkas tillstånd kräver att transportmedlet är särskilt inrättat för ändamålet men inte kräver avancerade sjukvårdinsatser under färden.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-760a-a5ff-27312f9db94d', '2015', 'Sjukvårdsrådgivning', 'Sjukvårdsrådgivning', 'Verksamhet där man specialiserat sig på att per telefon svara på medicinska frågor, bedöma behov av vård, hänvisa till olika vårdinstanser och ge egenvårdsråd.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7a90-bbb4-b68f06a2c2d7', '2016', 'Sterilisering, instrument', 'Sterilisering, instrument', 'Verksamhet där man specialiserat sig på att sterilisera medicinska instrument.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-724e-9329-4bebdc1b7006', '2017', 'Syncentral, verksamhet', 'Syncentral, verksamhet', 'Verksamhet där man bedriver habilitering och rehabilitering för personer med synskada. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-775a-bf62-56e6520522bb', '2021', 'Vårdhygienverksamhet', 'Vårdhygienverksamhet', 'Verksamhet där man informerar och utbildar vårdpersonal i vårdhygieniska frågor. Verksamheten inkluderar förebyggande insatser för att förhindra smittspridning och insatser för att ge stöd till vårdpersonal vid vårdrelaterade infektioner.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-785f-b1b1-c1c23ae740ea', '2022', 'Öppenvårdsapotek, verksamhet', 'Öppenvårdsapotek, verksamhet', 'Verksamhet där man tillhandahåller läkemedel och medicinska förbrukningsartiklar genom försäljning direkt till allmänheten. ', now(), now(), 'DB Import', 'DB Import', 1),
