    ('0191c6e9-b669-7aec-8f50-d3835dcc0146', '2025', 'Ambulanssjukvård', 'Ambulanssjukvård', 'Verksamhet där man erbjuder avancerade sjukvårdsinsatser i eller i anslutning till ambulanstransport.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-70ff-8246-b05c4acb96ee', '2026', 'Smittskyddsverksamhet', 'Smittskyddsverksamhet', 'Verksamhet där man planerar, organiserar och leder smittskyddet inom respektive landsting eller region.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-734d-a401-d0b09fec4468', '2027', 'Medicinsk hyperbarverksamhet', 'Medicinsk hyperbarverksamhet', 'Verksamhet där man med hjälp av tryckkammare behandlar t.ex. dykarsjuka, kroniska cirkulationsstörningar och vissa infektioner.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-737e-b20c-a6c624689429', '2028', 'Tolkcentral, verksamhet', 'Tolkcentral, verksamhet', 'Verksamhet där man erbjuder vardagstolkning till personer med dövhet, dövblindhet, vuxendövhet och hörselskada. Vardagstolkning innebär att få tolkhjälp i olika vardagssituationer som t.ex. vid sjukvårdsbesök, arbetsrelaterade uppdrag, familjeangelägenheter, fritids- och föreningsaktiviteter och vid viss samhällsservice.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7d88-ada8-af8e1ad65df5', '2029', 'Vaccination mot covid-19', 'Vaccination mot covid-19', 'Aktivitet som innebär att vaccinera mot covid-19.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7bfb-a703-9c920c667824', '2300', 'Äldreboende, verksamhet', 'Äldreboende, verksamhet', 'Verksamhet i ett boende där man tillhandahåller bostäder eller platser för heldygnsvistelse tillsammans med insatser i form av vård och omsorg för äldre personer med behov av särskilt stöd.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-754c-a94e-322b05d963ec', '2301', 'Gruppbostad, personer med demenssjukdom, verksamhet', 'Gruppbostad, personer med demenssjukdom, verksamhet', 'Verksamhet i ett boende där man tillhandahåller bostäder för ett begränsat antal personer med demenssjukdom som har omfattande tillsyns- och omvårdnadsbehov.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-781b-9167-c6823ae37322', '2302', 'Gruppbostad, personer m. psyk. funktionsneds., verksamhet', 'Gruppbostad, personer m. psyk. funktionsneds., verksamhet', 'Verksamhet i ett boende där man tillhandahåller bostäder för ett begränsat antal personer med psykisk funktionsnedsättning som har omfattande tillsyns- och omvårdnadsbehov.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7516-b5af-cce6812605b8', '2303', 'Gruppbostad, vuxna m. fys. funktionsneds., verksamhet', 'Gruppbostad, vuxna m. fys. funktionsneds., verksamhet', 'Verksamhet enligt LSS i ett boende där man tillhandahåller bostäder för maximalt sex vuxna som har fysiska funktionsnedsättningar och som har omfattande tillsyns- och omvårdnadsbehov.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7c53-a7cc-0432d04c908a', '2304', 'Stödboende, verksamhet', 'Stödboende, verksamhet', 'Verksamhet i ett boende där man tillhandahåller platser för heldygnsvistelse avsedda för personer som behöver insatser i form av tillsyn och stöd men inte vård eller behandling. Ett stödboende behöver inte tillstånd eller anmälas till Inspektionen för vård och omsorg (IVO) om det riktas till vuxna och när det inte finns betydande inslag av vård eller behandling i verksamheten. Ett stödboende kallas ibland t.ex. träningsboende eller utslussningsboende.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7e9e-aaae-380a8b460bee', '2306', 'Korttidsvård', 'Korttidsvård', '\"Verksamhet i ett boende där man tillhandahåller platser avsedda för tillfällig vård och omsorg dygnet runt för personer med omfattande tillsyns- och omvårdnadsbehov. Korttidsvården kan bestå av t.ex. rehabilitering, vård i livets slutskede och insatser i form av växelvård och avlösning av närstående. Korttidsvård kan även ges enligt LSS och gäller då oftast barn och ungdomar. En person kan också få korttidsvård i avvaktan på ett beslut om insatsbehov.\"', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7a35-8c2f-bc63dd51b163', '2307', 'Hem för vård el. boende, vuxna m. missbruks- el. beroendeproblem', 'Hem för vård el. boende, vuxna m. missbruks- el. beroendeproblem', 'Verksamhet i ett boende där man tillhandahåller platser för heldygnsvistelse tillsammans med insatser i form av vård eller behandling för vuxna personer med missbruks- eller beroendeproblem.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7d42-900b-c3b3e7c2b27e', '2308', 'Hem för vård el. boende, personer m. psyk. funktionsneds.', 'Hem för vård el. boende, personer m. psyk. funktionsneds.', 'Verksamhet i ett boende där man tillhandahåller platser för heldygnsvistelse tillsammans med insatser i form av vård eller behandling för personer med psykisk funktionsnedsättning.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7356-8a56-a28ccf013726', '2309', 'LVM-hem, verksamhet', 'LVM-hem, verksamhet', 'Verksamhet i ett boende där man tillhandahåller platser för heldygnsvistelse tillsammans med insatser i form av tvångsvård av personer med missbruks- eller beroendeproblem.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7fbf-bdcb-76828a34c89e', '2310', 'Servicebostad, verksamhet', 'Servicebostad, verksamhet', 'Verksamhet enligt LSS eller SoL där man tillhandahåller ett antal lägenheter med tillgång till gemensam service och personal på plats och där personligt stöd erbjuds i den omfattning den enskilde behöver. Lägenheterna är ofta anpassade efter den enskildes behov och ligger ofta samlade i samma hus eller kringliggande hus. En lägenhet i en servicebostad är en mellanform mellan en egen lägenhet i det ordinarie bostadsbeståndet och en lägenhet i en gruppbostad.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-774e-b2a3-f1515a72e35a', '2311', 'Dagverksamhet', 'Dagverksamhet', '\"Verksamhet där man för olika målgrupper erbjuder sysselsättning, gemenskap, behandling eller rehabilitering utanför den egna bostaden. Denna verksamhet är biståndsbedömd och bedrivs huvudsakligen under dagtid. Dagverksamhet kan ha olika inriktningar, t.ex. dagverksamhet för personer med demenssjukdomar eller för äldre som behöver social stimulans.\"', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7a5c-8f92-4eb0855c8d94', '2312', 'Öppen verksamhet', 'Öppen verksamhet', 'Verksamhet där man för olika målgrupper erbjuder social samvaro och annan aktivitet som inte är individuellt behovsprövad. Öppen verksamhet kan ha olika inriktningar, t.ex. kaféverksamhet, verksamheter vid andra träffpunkter för social samvaro eller verksamhet inriktad på rådgivning i olika former, såsom alkoholrådgivning eller föräldragrupper. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7948-817b-ca8c093f9d90', '2313', 'Daglig verksamhet', 'Daglig verksamhet', 'Verksamhet där man erbjuder insatser enligt LSS i form av meningsfull sysselsättning på dagtid till personer med funktionsnedsättning som inte kan söka sig till den vanliga arbetsmarknaden.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7913-92ba-76edbde77ba5', '2314', 'Daglig sysselsättning', 'Daglig sysselsättning', 'Verksamhet där man erbjuder insatser enligt SoL i form av meningsfull sysselsättning på dagtid till personer med psykisk funktionsnedsättning som inte kan söka sig till den vanliga arbetsmarknaden.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7942-a476-570fe3e2d9ce', '2315', 'Personlig assistans, verksamhet', 'Personlig assistans, verksamhet', 'Verksamhet där man erbjuder personlig assistans, det vill säga personligt utformat stöd, åt person som på grund av stora och varaktiga funktionsnedsättningar behöver hjälp med att tillgodose grundläggande behov. Personlig assistans erbjuds enligt LSS eller enligt 51 kap. Socialförsäkringsbalken, SFB.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7b3a-840c-fce0eab5dfac', '2316', 'Avlösarservice i hemmet, verksamhet', 'Avlösarservice i hemmet, verksamhet', 'Verksamhet där man enligt LSS erbjuder tillfälligt övertagande av stöd och service av en individ till dennes närstående eller familjehemsföräldrar med syftet att ge dessa möjlighet att få avkoppling och kunna uträtta sysslor utanför hemmet. Avlösarservice i hemmet kan erbjudas både som regelbunden insats och som en lösning vid akuta behov dygnet runt.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7134-85fc-46af7d16571e', '2317', 'Ledsagarservice, verksamhet', 'Ledsagarservice, verksamhet', 'Verksamhet där man erbjuder ledsagare, det vill säga följeslagare, till personer med omfattande funktionsnedsättningar med syftet att underlätta för dessa personer att komma ut och delta i samhällslivet, t.ex. besöka vänner, delta i fritidsaktiviteter eller kulturlivet.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7f0a-8d07-89c4cda8ae48', '2318', 'Hemtjänst, omvårdnadsverksamhet', 'Hemtjänst, omvårdnadsverksamhet', 'Verksamhet där man ger personlig omvårdnad till den enskilde i dennes bostad eller motsvarande. Personlig omvårdnad kan innebära hjälp med att t.ex. äta och dricka, klä sig, förflytta sig och sköta personlig hygien.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7328-9690-956b62b71807', '2319', 'Hemtjänst, serviceverksamhet', 'Hemtjänst, serviceverksamhet', 'Verksamhet där man ger service till den enskilde i dennes bostad eller motsvarande, t.ex. städning, matdistribution, inköp, avlösning av närstående och ledsagning.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7c00-a3b9-6ea71201faf5', '2320', 'Boendestöd, verksamhet', 'Boendestöd, verksamhet', '\"Verksamhet där man ger stöd i den dagliga livsföringen till bland annat personer med funktionsnedsättning eller missbruksproblem som bor i eget boende. Boendestöd kan innebära att personen får stöd i aktiviteter såsom tvättning, städning, inköp, ekonomisk planering, besök hos läkare eller social samvaro. Boendestödet anpassas till den enskildes behov av och möjligheter att utveckla ett normalt vardagsliv.\"', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7257-ac37-c13eb8183072', '2321', 'Familjerådgivning', 'Familjerådgivning', 'Verksamhet där man erbjuder stöd till personer som behöver bearbeta samlevnadskonflikter i parförhållanden och familjer. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7cdc-89c4-021606ae9aee', '2322', 'Familjecentral, verksamhet', 'Familjecentral, verksamhet', 'Verksamhet där man erbjuder föräldrar och barn en rad stödjande och förebyggande insatser samlat under ett tak. I verksamheten kan t.ex. finnas MVC, BVC, öppen förskola och socialtjänst med inriktning på förebyggande arbete.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-75c1-aed2-de4778700f0b', '2323', 'Familjerätt, verksamhet', 'Familjerätt, verksamhet', 'Verksamhet där man handlägger familjerättsliga ärenden såsom vårdnad, boende och umgänge, samarbetssamtal, adoption, faderskap och föräldraskap.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7c54-a349-44099ef8e567', '2324', 'Personligt ombud, verksamhet', 'Personligt ombud, verksamhet', 'Verksamhet där man till personer med psykisk funktionsnedsättning erbjuder stöd i form av råd och hjälp i kontakter med myndigheter, hälso- och sjukvården, kommunen etc. Det personliga ombudet hjälper till med att formulera personens behov av vård, omsorg och service.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7fdf-9487-3b920de1ab60', '2325', 'Anhörigstöd, verksamhet', 'Anhörigstöd, verksamhet', '\"Verksamhet där man erbjuder rådgivning och stöd till personer som har en närstående med sjukdom, missbruks- eller beroendeproblem eller fysisk eller psykisk funktionsnedsättning. Anhörigstöd förekommer i vissa fall i form av anhöriggrupper där personer kan träffa andra anhöriga i liknande situation för att utbyta erfarenheter.\"', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-78fc-9f5e-0077c929209c', '2326', 'Stöd till brottsoffer, verksamhet', 'Stöd till brottsoffer, verksamhet', 'Verksamhet där man erbjuder stöd och hjälp till personer som utsatts för brott och dessa personers närstående. I verksamheten kan man även ge stöd och hjälp till personer som utsatts för våld i nära relationer.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-766a-9aab-e8ff0c688f25', '2327', 'Stöd till våldutövare, verksamhet', 'Stöd till våldutövare, verksamhet', 'Verksamhet där man erbjuder stöd och hjälp till personer som utsätter närstående för våld och hot att kunna hantera ilska och konfliktsituationer utan att använda våld. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-705a-9e96-71f35559d79c', '2328', 'Praktikplatser och kompetenshöjande insatser, verksamhet', 'Praktikplatser och kompetenshöjande insatser, verksamhet', 'Verksamhet där man enligt SoL (4:4) under begränsad tid erbjuder praktikplatser och kompetenshöjande insatser till personer som ansöker om ekonomiskt bistånd och som behöver stöd till att bli självförsörjande.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-749c-9e83-94226b830932', '2329', 'Myndighetsutövning inom äldreomsorg', 'Myndighetsutövning inom äldreomsorg', 'Verksamhet inom äldreomsorg där man utreder, bedömer och beslutar om olika insatser enligt SoL.', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-776e-9df7-8db010de9cf6', '2330', 'Myndighetsutövning inom individ- och familjeomsorg', 'Myndighetsutövning inom individ- och familjeomsorg', 'Verksamhet inom individ- och familjeomsorg där man utreder, bedömer och beslutar om olika insatser enligt SoL, LVU och LVM. ', now(), now(), 'DB Import', 'DB Import', 1),
    ('0191c6e9-b669-7d2e-b779-b84bc1683a77', '2331', 'Myndighetsutövning inom området personer med funktionsneds.', 'Myndighetsutövning inom området personer med funktionsneds.', 'Verksamhet där man inom området stöd och service till personer med funktionsnedsättning utreder, bedömer och beslutar om olika insatser enligt LSS eller SoL.', now(), now(), 'DB Import', 'DB Import', 1),
